import{_ as i,c as l,o as a,a5 as t}from"./chunks/framework.CJNr4pYi.js";const g=JSON.parse('{"title":"Linux unzip命令","description":"","frontmatter":{},"headers":[],"relativePath":"linux/命令/备份压缩/unzip.md","filePath":"linux/命令/备份压缩/unzip.md","lastUpdated":1722327281000}'),e={name:"linux/命令/备份压缩/unzip.md"},n=t('<h1 id="linux-unzip命令" tabindex="-1">Linux unzip命令 <a class="header-anchor" href="#linux-unzip命令" aria-label="Permalink to &quot;Linux unzip命令&quot;">​</a></h1><p>Linux unzip命令用于解压缩zip文件 unzip为.zip压缩文件的解压缩程序。</p><h3 id="语法" tabindex="-1">语法 <a class="header-anchor" href="#语法" aria-label="Permalink to &quot;语法&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>unzip [-cflptuvz][-agCjLMnoqsVX][-P &lt;密码&gt;][.zip文件][文件][-d &lt;目录&gt;][-x &lt;文件&gt;] 或 unzip [-Z]</span></span></code></pre></div><p><strong>参数</strong> ：</p><ul><li>-c 将解压缩的结果显示到屏幕上，并对字符做适当的转换。</li><li>-f 更新现有的文件。</li><li>-l 显示压缩文件内所包含的文件。</li><li>-p 与-c参数类似，会将解压缩的结果显示到屏幕上，但不会执行任何的转换。</li><li>-t 检查压缩文件是否正确。</li><li>-u 与-f参数类似，但是除了更新现有的文件外，也会将压缩文件中的其他文件解压缩到目录中。</li><li>-v 执行是时显示详细的信息。</li><li>-z 仅显示压缩文件的备注文字。</li><li>-a 对文本文件进行必要的字符转换。</li><li>-b 不要对文本文件进行字符转换。</li><li>-C 压缩文件中的文件名称区分大小写。</li><li>-j 不处理压缩文件中原有的目录路径。</li><li>-L 将压缩文件中的全部文件名改为小写。</li><li>-M 将输出结果送到more程序处理。</li><li>-n 解压缩时不要覆盖原有的文件。</li><li>-o 不必先询问用户，unzip执行后覆盖原有文件。</li><li>-P&lt;密码&gt; 使用zip的密码选项。</li><li>-q 执行时不显示任何信息。</li><li>-s 将文件名中的空白字符转换为底线字符。</li><li>-V 保留VMS的文件版本信息。</li><li>-X 解压缩时同时回存文件原来的UID/GID。</li><li>[.zip文件] 指定.zip压缩文件。</li><li>[文件] 指定要处理.zip压缩文件中的哪些文件。</li><li>-d&lt;目录&gt; 指定文件解压缩后所要存储的目录。</li><li>-x&lt;文件&gt; 指定不要处理.zip压缩文件中的哪些文件。</li><li>-Z unzip -Z等于执行zipinfo指令。</li></ul><h3 id="实例" tabindex="-1">实例 <a class="header-anchor" href="#实例" aria-label="Permalink to &quot;实例&quot;">​</a></h3><p>查看压缩文件中包含的文件：</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>unzip -l abc.zip</span></span></code></pre></div><p>-v 参数用于查看压缩文件目录信息，但是不解压该文件。</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>unzip -v abc.zip</span></span></code></pre></div>',11),p=[n];function s(o,c,u,d,r,h){return a(),l("div",null,p)}const _=i(e,[["render",s]]);export{g as __pageData,_ as default};
